import React from "react";
import styled, { css } from "styled-components";

const BannerBlock = styled.div`
  padding-left: 22.16%;
  padding-top: 36.95%;
`;

const Text1 = styled.div`
  font-family: NanumSqaureExtraBold;
  font-size: 52px;
  line-height: 78px;
`;
const Text2 = styled.div`
  font-family: Kanit;
  font-size: 64px;
  line-height: 78px;
`;
const Text3 = styled.div`
  font-family: NanumSquareBold;
  font-size: 28px;
  line-height: 48px;
`;
const Form = styled.div`
  width: 280px;
  height: 48px;
  padding-right: 7%;
  padding-bottom: 16.7%;
`;
function MainBanner() {
  return (
    <BannerBlock>
      <Text1> 성장하는 즐거움,</Text1>
      <Text2>EndlessCreation</Text2>
      <Text3>
        신입기수 모집 중(~3/?)
        <br /> 31기 여러분들을 기다리고 있어요
      </Text3>
      <Form>31기 지원</Form>
    </BannerBlock>
  );
}

export default MainBanner;
